"Me lejen tuaj, OnePlus do të mbledhë informacione për përdorimin e telefonit tuaj me qëllim që të përmirësojë dizajnin e produktit dhe eksperiencën e përdoruesit. Nëse jeni dakord të bashkoheni me programin e eksperiencës së përdoruesit (\"programi\"), kjo tregon se jeni dakord që OnePlus të grumbullojë, përdorë dhe analizojë informacionet e mëposhtme: 
 (1) Të dhënat e konfigurimit;
 (2) Të dhëna statistikore për programin e aplikacionit;
 (3) Të dhëna për sjelljen e përdoruesit;
 Duke grumbulluar dhe analizuar të dhënat e mësipërme, OnePlus synon të përmirësojë eksperiencën e përdoruesit, e gjithë procedura është në një formë anonime dhe e enkriptuar për OnePlus, si për shembull përmes përmirësimit të efikasitetit të baterisë dhe stabilitetit të sistemit. Këto të dhëna nuk do të përdoren për asnjë lloj njohjeje të identitetit personal. Pasi të bashkoheni me programin, mund të tërhiqeni në çfarëdo kohe duke ndjekur metodën e mëposhtme: Cilësimet - Të avancuara - Programi për eksperiencën e përdoruesit, dhe duke e çzgjedhur kutinë. Ju lutemi shikoni rregulloren për privatësinë të OnePlus për të mësuar më shumë rreth informacioneve personale që përpunohen nga OnePlus. Pasi të tërhiqeni nga programi, OnePlus do të ndalojë mbledhjen e informacioneve tuaja të përmendura më sipër."
